Rungtynių pradžia šeimininkams nieko bloga nežadėjo. Asociacijos „Hockey Lietuva“ prezidentas  Petras Nausėda  (09:58) kalė įvartį nuo mėlynos linijos ir išvedė komandą į priekį. Kėlinio pabaigoje vilnietis Artūras Švedavičius (18:23, dauguma) išnaudojo kiekybinę persvarą ir grąžino kovą į pradinę padėtį. Drausmė buvo didžiausia „Kaunas Hockey“ klubo rykštė šiose rungtynėse. Vilniečiai persvėrė rezultatą po Valdo Pikčiaus metimo dvigubos daugumos metu (26:37), o ant ledo grįžus vienam kauniečiui „Hockey Punks“ dar kartą išnaudojo kiekybinę persvarą, kai sostinės klubo pranašuą padvigubino Edgaras Rybakovas (27:18, dauguma). Lyg to skausmo šeimininkams būtų maža, vilnietis Šarūnas Suchomlinas (39:48) kalė įvartį „į rūbinę“ ir „Hockey Punks“ atitrūko net 4:1. Trečiojo kėlinio pradžioje  Laisvydas Rimkus  (41:13) čempionato lyderiams priminė, kad šiame sezone Lietuvos čempionate reikia skaitytis su visais varžovais - padidino skirtumą jau iki keturių įvarčių. Kaunietis Vytautas Jagelavičius (45:56) dar sušvelnino skirtumą iki 2:6, tačiau didesnio spurto inicijuoti nepavyko. Kauniečiai į varžovų vartus metė 34 kartus, vilniečių pergalei užteko 26 metimų. (function(d, s, i, r) {
